import Member from "./Member";

export default function membersList({members}){

    let sortedMembers;
    sortedMembers = members
    .slice()
    .sort((a,b) => (Number(b.calorieRecord)) - (Number(a.calorieRecord)))

    return(
        <ul>{
            
           sortedMembers.map((member, index) =>
           <Member
            member={member}
            key={index}
           />

        )} 
        </ul>
    )
}
